import React from "react";
import styled from "styled-components";
import { GiHamburgerMenu } from "react-icons/gi";
import { AiOutlineSearch } from "react-icons/ai";
const SecondNavbar = () => {
  return (
    <Wrapper>
      <div classname="containermain">
        <div>
          <GiHamburgerMenu />
          Kateqoriyalari goster
        </div>

        <div>
          <input type="text" placeholder="Mehsul axtar" className="secinput" />
          <AiOutlineSearch />
        </div>
      </div>
    </Wrapper>
  );
};

const Wrapper = styled.div`
  width: 100%;
  background: var(--main-color);
  height: 10vh;
  display: flex;

  .containermain {
      background: red;
      width: 80%;
      margin-left: 30px;

  }
  .secinput {
    width: 100%;
    height: 30PX;
  }
`;
export default SecondNavbar;
